import React, { useState , useEffect } from 'react'
import axios from 'axios'
import '../../Assets/Styles/Job/Job.css'
import Jobs from './Jobs'

function Home() {
  const url = `https://dummyjson.com/products/`
  const [job, setJob] = useState({
    loading:false,
    data: null,
    error: false,
  })

  useEffect(() =>{
    setJob({
      loading: true,
      data: null,
      error:false,
    })

    axios.get(url)
      .then(response=>{
        setJob({
          loading: true,
          data: response.data,
          error:false,
        })
      })
      .catch(()=>{
        setJob({
          loading: true,
          data: null,
          error:false,

        })
      })
    }, [url])

  let content = null


  if(job.error){
    content = <p>Xəta baş verdi, zəhmət olmasa səhifəni yeniləyin və ya daha sonra müraciət edin.</p>
  }

  return (
    <div>
      Job Lists
      {content}
    </div>


  )
}

export default Home
